const ProductListContainer = () => {
    const url = 'http://localhost:8000/Products';

    let data = [];

    (async function getData () {

        const response = await fetch(url, {method: "GET"})
        data = await response.json();
        console.log(data);

    })();

    return (
        <ProductList />
    )
}

export default ProductListContainer;
